import "../Style/homepage.css";

function Login() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>로그인 페이지</h1>
      </header>
      <div className="App-content">
        <p>여기에 로그인 폼을 추가하세요.</p>
      </div>
    </div>
  );
}
